import Vue from 'vue';
import App from './App.vue';
import axios from 'axios';



axios.defaults.baseURL = 'http://localhost:3000'; // Sua URL do servidor

Vue.prototype.$http = axios; // Adicione o Axios como um plugin Vue

new Vue({
  render: (h) => h(App),
}).$mount('#app');
